    private val (names, codes) =
    {
        val ns = namespaces
        
        val names = for ((wiki, spaces) <- ns) yield {
            val rev = for ((name, code) <- spaces) yield (code, name)
            (wiki, rev.toMap)
        }
        
        val codes = for ((wiki, spaces) <- ns) yield {
            val locale = Language(wiki).locale
            val low = for ((name, code) <- spaces) yield (name.toLowerCase(locale), code)
            (wiki, low.toMap)
        }
        
        (names.toMap, codes.toMap)
    }

    def getName(lang : Language, ns : Namespace) : String =
    {
        val n = names.getOrElse(lang.wikiCode, throw new IllegalArgumentException("no namespace names found for language '"+lang.wikiCode+"'"))
        n.getOrElse(ns.id, throw new IllegalArgumentException("namespace number "+ns.id+" not found for language '"+lang.wikiCode+"'")) 
    }

    def getCode(lang : Language, ns : String) : Option[Int] =
    {
        val c = codes.getOrElse(lang.wikiCode, throw new IllegalArgumentException("no namespace codes found for language '"+lang.wikiCode+"'"))
        c.get(ns.toLowerCase(lang.locale))
    }

